import gql from 'graphql-tag';

export const mainQuery = gql`{
    Artist @client {
      Name
      ArtistId
    }
    Album @client {
      Title
      AlbumId
    }
}`;

export const mainQueryCache = gql`{
  Artist {
    Name
    ArtistId
  }
  Album {
    Title
    AlbumId
  }
}
`;
